import React from "react";
import "./product.css";

function product() {
  return (
    <div className="product">
      <div className="product_info">
        <p>Product Info</p>
        <p className="proct_price">
          <small>$</small>
          <strong>19.99</strong>
        </p>
        <div className="product_rating">
          <p>⭐⭐⭐⭐⭐</p>
        </div>
      </div>

      <img src="https://m.media-amazon.com/images/I/71SAHzzQqkL._SL1500_.jpg" />
    </div>
  );
}

export default product;
